INSERT INTO `tbl_pages` (`id`, `title`, `content`, `image`, `status`, `meta_title`, `meta_desc`, `created_date`, `updated_date`) VALUES
(2, 'About Us', '<p><span style=\"color: #8d9896; font-family: Raleway, sans-serif; font-size: 18px; background-color: #e5e5e5;\">Harrow Trading was founded in 2008 in London. We started working for high end lighting companies who execute bespoke lighting projects for various prestigious hotels, historic places, yachts and private homes. We earned a good reputation amongst the manufacturers of designer lighting companies. Moving forward we added some quality home d&eacute;cor in our portfolio. We are working tirelessly to bring hidden artisan to the world&rsquo;s attention, so that they can sense the Real Heritage.</span></p>', 'about-us-inner.jpg', 1, 'About Us', '<p>About Us</p>', '2019-07-01 12:33:12', '2019-07-01 15:03:33'),
(3, 'Bespoke Lightening', '<p><span style=\"color: #303131; font-family: Raleway, sans-serif; font-size: 20px; text-align: center; background-color: #e5e5e5;\">All our bespoke developments are based on customer designs. Our customers provide us the details in the form of CAD drawings or sketches and we start the process of developing the product. In this process, our emphasis is on Customer’s requirement in order to develop high quality products. We use our expertise and versatile knowledge of our skilled craftsman to develop the desired product. We can also work from ideas, designs or pictures. As all our lighting projects are bespoke and some of these projects are for private homes, images of these projects can not be published on public platforms for privacy reasons. We are successfully working with the UK’s top lighting designer companies for more than a decade.</span></p>', 'bespoke-banner.jpg', 1, 'Bespoke Lightening', '<p>Bespoke Lightening</p>', '2019-07-01 13:04:34', '2021-06-16 05:47:28');
